import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';

function App() {
  return (
    <Router>
      <div className="App">

        <Switch>
          <Route path="/"/>
          <Route path="/about" />
          <Route path="/contact" />
        </Switch>

      </div>
    </Router>
  );
}

export default App;
